import React, {Component} from 'react';
import Header from './../header/header';
import Footer from './../footer/footer';


class Layout extends Component {
    render(){
        return(
            <div>
            <div id="fb-root"></div>
            <noscript>
                <iframe src="https://www.googletagmanager.com/ns.html?id=GTM-TF6M58Q" height="0" width="0" style={styleProps}></iframe>
            </noscript>
            <noscript>You need to enable JavaScript to run this app.</noscript>
            <NavHeader/>
            {this.props.children}
            <AppFooter/>
            <script dangerouslySetInnerHTML={this.setServiceWorker()}></script>
            </div>
        );
    }
}

module.exports
